export interface Meta {
    [key: string]: any;
}
export interface ErrorObject {
    id?: string;
    links?: {
        about: string;
    };
    status?: string;
    code?: string;
    title?: string;
    detail?: string;
    source?: {
        pointer?: string;
        parameter?: string;
    };
    meta?: Meta;
}
export interface Link {
    href: string;
    meta?: Meta;
}
export interface ResourceIdentifier extends Object {
    id: string;
    type: string;
    meta?: Meta;
}
export interface Resource extends ResourceIdentifier {
    attributes?: {
        [key: string]: any;
    };
    relationships?: {
        [key: string]: Relationship;
    };
    links?: {
        self?: string | Link;
    };
}
export interface Relationship {
    data?: ResourceIdentifier | ResourceIdentifier[] | null;
    links?: {
        self?: string | Link;
        related?: string | Link;
    };
    meta?: Meta;
}
export interface CompoundDocument<T extends Resource | ResourceIdentifier | ResourceIdentifier[] | Resource[] | null> {
    jsonapi?: {
        version: string;
    };
    data?: T;
    errors?: ErrorObject[];
    meta?: Meta;
    links?: {
        self?: string | Link;
        related?: string | Link;
        first?: string | Link;
        last?: string | Link;
        next?: string | Link;
        prev?: string | Link;
        [key: string]: string | Link | undefined;
    };
    included?: Resource[];
}
